import { GridBtn } from "../../../devComponent";
import {AvatarClient, Button, Div, Flex, Grid, Lable, memo, Icon,Name} from "../../../importAll";

const hpIcon             = require("../../../Images/icons/hp.png")          
const strongIcon         = require("../../../Images/icons/strong.png")              
const energyIcon         = require("../../../Images/icons/energy.png")              
const refillEnergyIcon   = require("../../../Images/icons/refillEnergy.png")                  
const silverIcon         = require("../../../Images/icons/silver.png")              
const goldIcon           = require("../../../Images/icons/gold.png")          
const redPowderIcon      = require("../../../Images/icons/redPowder.png")              
const diamondIcon        = require("../../../Images/icons/diamond.png")              


const AvatarSelector = memo((props:IAvatarSelectorProps)=>{
    const deleteAvatar = ()=>{}

    return (
        <Grid className="avatarSelector" {...props} rows={50} columns={50} width="95%" height="15%" margin="0px auto" >
            <Name bgColor family="cursive" XYcenter start="18,2" end="33,14" rtl > {props.avatar.name}</Name>


            <Flex rtl bgColor start="7,17" end="44,31" >
                <AvatarSelectorValue icon={hpIcon} width="23%"/>

            </Flex>


            <Div Empty className="Controll">
                <Button onClick={deleteAvatar} start="1,1" end="1,15" bgColor="red"/>
            </Div>
        </Grid>
    )
})

interface IAvatarSelectorProps extends IGlobalProps{
    avatar:AvatarClient; 
}
export default AvatarSelector;




function AvatarSelectorValue(props:IAvatarSelectorValueProps){
    return(
        <Flex rtl {...props}>
            <Icon bgImg={props.icon} width="30%"/> 
            <Lable family="cursive" XYcenter width="70%" ltr fSize={11}>{props.value}</Lable>
        </Flex>
    )
}

interface IAvatarSelectorValueProps extends IGlobalProps{
    icon:any; 
}
